import {  useSelector ,} from "react-redux";
import {useState} from 'react'
import Card from "../card/Card";

export default function Team() {
  const team=useSelector(store =>store.pokemon.team)
  const [state,setState] = useState(team);
  return (
    <div>
      <br/>
      <br/>
      <br/>
      <br/>
      <hi>hola</hi>
      <div>
        {
          state?.map(({name,hp,id,life,speed,type})=> <ul key={id}>
            <li>name:{name}</li>
            <li>hp:{hp}</li>
            <li>id:{id}</li>
            <li>speed:{speed}</li>
            <li>life:{life}</li>
            <li>type:{type}</li>
            <img src={'https://media3.giphy.com/media/DRfu7BT8ZK1uo/giphy.gif?cid=ecf05e47gnw179bell2grclua6wv313jklkjigupmkui19nl&rid=giphy.gif&ct=g'} width={40} />
            </ul>
          )
        }
      </div>
    </div>
  )
}
